import './App.css';
import Result from './Result';
import React from 'react';
import { Route, BrowserRouter as Router, Routes } from "react-router-dom";

import Home from './Home';

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route path='/' element={<Home/>}/>
          <Route path='/result' element={<Result/>}/>
        </Routes>
      </Router>
    </div>
  );
}

export default App;
